import React, { Component } from "react";
import "./style/Explore.css";
import { Link } from "react-router-dom";
import { Card, Button, Container, Row, Col, Image } from "react-bootstrap";
import Hobbies from "./explore-component/Hobbies";

export default class Explore extends Component {
  Hobbies = () => {
    return (
      <>
        <div className="mx-5 mt-5">
          <h3>Hobbies</h3>
          <hr></hr>
          <Container>
            <Row>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Movies</h5>
              </Col>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Books</h5>
              </Col>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Cook</h5>
              </Col>
            </Row>
          </Container>
        </div>

        <div></div>
      </>
    );
  };

  Tools = () => {
    return (
      <>
        <div className="mx-5 mt-5">
          <h3>Tools</h3>
          <hr></hr>
          <Container>
            <Row>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Movies</h5>
              </Col>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Books</h5>
              </Col>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Cook</h5>
              </Col>
            </Row>
          </Container>
        </div>
      </>
    );
  };

  Games = () => {
    return (
      <>
        <div className="mx-5 mt-5">
          <h3>Games</h3>
          <hr></hr>
          <Container>
            <Row>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Movies</h5>
              </Col>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Books</h5>
              </Col>
              <Col xs={6} md={4}>
                <img
                  src={require("../pic/movie.png")}
                  className="img-thumbnail"
                />
                <h5 className="bottom-left mb-0 ml-2">Cook</h5>
              </Col>
            </Row>
          </Container>
        </div>
      </>
    );
  };

  render() {
    return (
      <div>
        <this.Hobbies />

        <div></div>
      </div>
    );
  }
}
